import { makeStyles } from "@material-ui/core/styles";
import TextField from '@material-ui/core/TextField';


const useStyles = makeStyles((theme) => ({
    root: {
      '& > *': {
        margin: theme.spacing(1),
        width: '5',
      },

    },
    TextField: {
        color: "White",
        fontSize: "16px",
    },
  }));

export default function Main(){

    const classes = useStyles();
    const characters = ['我','的','你','是','了'];
    const pinyin = ['wǒ','de','nǐ','shì','le'];
    var selectedCharacter = 0;

    return(
        <div>
            <h1>
                {characters[selectedCharacter]}
            </h1>
            <form className={classes.root} noValidate autoComplete="off" color="white">
                <TextField id="standard-basic" label="" inputProps={{className: classes.TextField,min: 0, style: { textAlign: 'center' }}} color="white"/>
            </form>

        </div>
    );
}
